import React from "react";
import Logo from "../assets/logo.png"; // Adjust the path as necessary

const Navbar = () => {
  return (
    <div>
      {/* Upper Navbar */}
      <div>
        <div>
          <a href="#">
            <img src={Logo} alt="Logo" s/>
          </a>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
